import React, { useState } from "react";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="bg-gray-200 text-gray-900 shadow-md fixed top-0 w-full z-50">
      <div className="flex justify-between items-center px-6 py-4">
        {/* Logo */}
        <div className="text-2xl font-bold text-blue-600">WatchKart</div>

        {/* Desktop Menu */}
        <div className="hidden md:flex space-x-6">
          <a href="#home" className="hover:text-blue-600 font-medium">Home</a>
          <a href="#about" className="hover:text-blue-600 font-medium">About</a>
          <a href="#products" className="hover:text-blue-600 font-medium">Products</a>
        </div>

        {/* Hamburger Icon */}
        <div className="md:hidden">
          <button onClick={() => setIsOpen(!isOpen)} className="focus:outline-none">
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              {isOpen ? (
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
              ) : (
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
              )}
            </svg>
          </button>
        </div>
      </div>

      {/* Mobile Menu */}
      {isOpen && (
        <div className="md:hidden flex flex-col items-center pb-4 space-y-2">
          <a href="#home" className="hover:text-blue-600 font-medium">Home</a>
          <a href="#about" className="hover:text-blue-600 font-medium">About</a>
          <a href="#products" className="hover:text-blue-600 font-medium">Products</a>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
